angular.module("contactInfo").factory("LoadingIndicatorInterceptor",["$q","$injector","LoadingService",function(e,r,n){return{request:function(r){return n.show(),r},requestError:function(r){return n.hide(),e.reject(r)},response:function(r){return n.hide(),r},responseError:function(r){return n.hide(),e.reject(r)}}}]);